import Nav from "../components/Nav";
import Hero from "../components/Hero";

const HomePage = () => {
	return (
		<div className="bg-white w-[70%] h-[85%] rounded-xl shadow-xl">
			<Nav />
			<Hero />
		</div>
	);
};

export default HomePage;
